import React from "react";

class Clickimg extends React.Component {

  state = {
    img: "https://cdn-02.independent.ie/regionals/kerryman/news/article34250758.ece/AUTOCROP/w620/2015-12-02_ker_15039481_I1.JPG",
    img2: "https://www.nydailynews.com/resizer/3vON2MK4UseCi-KcXQxivVXOPxk=/800x0/arc-anglerfish-arc2-prod-tronc.s3.amazonaws.com/public/4FLF6TGOFJSOHINHYGZABAQBFM.jpg",
    img3: 0,
    img4: 0,
    img5: 0,
    img6: 0,
    img7: 0,
    img8: 0,
    img9: 0,
    img10: 0,
    img11: 0,
    img12: 0,
  }
  render() {
    console.log(this.state)
    return (
      <div>
        <img className="card-image" src={this.state.img}></img>
      </div>
    );
  }

}

export default Clickimg;
